import './style.css';
import Cards from "./Cards";
import Welcome from "./Welcome";
import Contact from "./Contact";
import About from "./About";

import { Link } from "react-scroll";


const MyComponent = () => {


  const menuItems = [
    {
      id: 1,
      title: "home",
    },
    {
      id: 2,
      title: "portfolio",
    },
    {
      id: 3,
      title: "contact",
    },
    {
      id: 4,
      title: "about",
    },
  ];




  return (
    <>
        <>
          <nav>
            <div className='logo'><h2>Company name</h2></div>

            <div className='item-cont'>
              <a href="">Home</a>
              <a href="">Services</a>
              <a href="">Contact us</a>
              <a href="">About us</a>
            </div>
          </nav>
          <Welcome/>
          <div id='cards-sec'><Cards/></div>
          <div id="contact-sec"></div><Contact/>
          <div id="about-sec"></div><About/>
        </>
    </>







  );
};

export default MyComponent;
